<template>
  <button type="button" class="btn btn-primary" @click="router.push('/abb')">
    ページ遷移dayo</button
  ><br />
  <button type="button" class="btn btn-primary" @click="clickDraw">作図</button
  ><br />
  <button
    type="button"
    class="btn btn-primary"
    @click="clickStartAccelerationSensor"
  >
    加速度センサーを有効にする</button
  ><br />
  <!-- <LineChart :chart-data="chartAcceleration" /> -->
  <GBowl
    :x="adjust_g_acceleration_x"
    :y="adjust_g_acceleration_y"
    :draw="draw"
  />

  <!-- G_X -->
  <div class="row">
    <div class="col">
      <div class="form-floating">
        <input
          id="inputGyroX"
          v-model="adjust_g_acceleration_x"
          type="text"
          class="form-control"
        />
        <label for="inputGyroX">x</label>
      </div>
    </div>
  </div>
  <!-- G_Y -->
  <div class="row">
    <div class="col">
      <div class="form-floating">
        <input
          id="floatingInputGrid"
          v-model="adjust_g_acceleration_y"
          type="email"
          class="form-control"
          placeholder="name@example.com"
        />
        <label for="floatingInputGrid">y</label>
      </div>
    </div>
  </div>
  <!-- ANGLE -->
  <div class="row">
    <div class="col">
      <div class="form-floating">
        <input
          id="floatingInputGrid"
          v-model="angle"
          type="email"
          class="form-control"
          placeholder="name@example.com"
        />
        <label for="floatingInputGrid">ANGLE</label>
      </div>
    </div>
  </div>
</template>

<script lang="ts">
import { defineComponent, ref, inject, reactive } from 'vue'
import { useRouter } from 'vue-router'
import {
  useAccelerationSensortKey,
  useAccelerationSensortType,
} from '@/libs/device/accelerationSensor'

import { pointToAtan2 } from '@/libs/trigonometric'

import GBowl from '@/components/GBowl.vue'
//import LineChart from '@/components/chart/LineChart'
// import { max_g } from '@/libs/constants'
// import { useDeviceKey, useDeviceType } from '@/libs/device/device'

export default defineComponent({
  components: {
    GBowl,
    //LineChart,
  },
  setup() {
    const router = useRouter()
    // const useDevice = inject(useDeviceKey) as useDeviceType

    // var req = new XMLHttpRequest()
    // req.open(
    //   'GET',
    //   'https://848f-60-91-83-78.ngrok.io/storage/04G12.mp3',
    //   false
    // )
    // req.send(null)
    // const audio_base64 = window.btoa(req.responseText)

    // const j03G01 =
    //   'data:audio/mp3;base64,'
    const j03G02 =
      'data:audio/mp3;base64,'
    const j03G03 =
      'data:audio/mp3;base64,'
    const j03G04 =
      'data:audio/mp3;base64,'
    const j03G05 =
      'data:audio/mp3;base64,'
    const j03G06 =
      'data:audio/mp3;base64,'
    const j03G07 =
      'data:audio/mp3;base64,'
    const j03G08 =
      'data:audio/mp3;base64,'
    const j03G09 =
      'data:audio/mp3;base64,'
    const j03G10 =
      'data:audio/mp3;base64,'
    const j03G11 =
      'data:audio/mp3;base64,'
    const j03G12 =
      'data:audio/mp3;base64,'

    const draw = ref(false)
    const adjust_g_acceleration_x = ref(0)
    const adjust_g_acceleration_y = ref(0)

    const adjust_g_acceleration_x_log = [] as number[]
    const adjust_g_acceleration_y_log = [] as number[]

    // 加速度センサーのチャートデータ
    const chartAcceleration = reactive({
      labels: [] as string[],
      datasets: [
        {
          label: 'x',
          backgroundColor: '#f87979',
          borderColor: '#f87979',
          data: [] as number[],
          fill: false,
          tension: 0.2,
        },
        {
          label: 'y',
          backgroundColor: '#0d6efd',
          borderColor: '#0d6efd',
          data: [] as number[],
          fill: false,
          tension: 0.2,
        },
      ],
    })

    // 加速度センサーの調整値
    let calibration_acceleration_x = 0
    let calibration_acceleration_y = 0

    // 加速度センサーモジュール
    const useAccelerationSensor = inject(
      useAccelerationSensortKey
    ) as useAccelerationSensortType

    // 「加速度センサーを有効にする」押下
    const clickStartAccelerationSensor = () => {
      useAccelerationSensor.addEvent(deviceAcceleration)
      useAccelerationSensor.enableSensor()
      // // audioAPi
      // const audioContext = new AudioContext()
      // const oscillatorNode = audioContext.createOscillator()
      // oscillatorNode.frequency.value = 523.251
      // oscillatorNode.type = 'triangle'
      // oscillatorNode.connect(audioContext.destination)
      // oscillatorNode.start()
    }

    const angle = ref(0)

    // 「作図」押下
    const clickDraw = () => {
      // LineChart
      chartAcceleration.labels = [
        ...Array(adjust_g_acceleration_x_log.length),
      ].map(() => '')
      chartAcceleration.datasets[0].data = adjust_g_acceleration_x_log
      chartAcceleration.datasets[1].data = adjust_g_acceleration_y_log

      //const music = new Audio(localStorage['04G12'])

      draw.value = true

      //const music_03G01 = new Audio(j03G01)
      const music_03G02 = new Audio(j03G02)
      const music_03G03 = new Audio(j03G03)
      const music_03G04 = new Audio(j03G04)
      const music_03G05 = new Audio(j03G05)
      const music_03G06 = new Audio(j03G06)
      const music_03G07 = new Audio(j03G07)
      const music_03G08 = new Audio(j03G08)
      const music_03G09 = new Audio(j03G09)
      const music_03G10 = new Audio(j03G10)
      const music_03G11 = new Audio(j03G11)
      const music_03G12 = new Audio(j03G12)

      setInterval(() => {
        const g_xy =
          Math.ceil(
            Math.sqrt(
              adjust_g_acceleration_x.value ** 2 +
                adjust_g_acceleration_y.value ** 2
            ) * 10
          ) / 10

        if (g_xy < 0.2) {
          return
        }
        if (g_xy < 0.3) {
          music_03G02.play()
          return
        }
        if (g_xy < 0.4) {
          music_03G03.play()
          return
        }
        if (g_xy < 0.5) {
          music_03G04.play()
          return
        }
        if (g_xy < 0.6) {
          music_03G05.play()
          return
        }
        if (g_xy < 0.7) {
          music_03G06.play()
          return
        }
        if (g_xy < 0.8) {
          music_03G07.play()
          return
        }
        if (g_xy < 0.9) {
          music_03G08.play()
          return
        }
        if (g_xy < 1) {
          music_03G09.play()
          return
        }
        if (g_xy < 1.1) {
          music_03G10.play()
          return
        }
        if (g_xy < 1.2) {
          music_03G11.play()
          return
        }
        if (g_xy < 1.3) {
          music_03G12.play()
          return
        }
      }, 500)
    }

    let before_g_x = 0
    let before_g_y = 0
    const deviceAcceleration = (e: DeviceMotionEvent) => {
      // 加速度センサーが有効になっているか？
      if (!useAccelerationSensor.stateRefs.isEnable.value) return
      if (
        e.acceleration === null ||
        e.acceleration.x === null ||
        e.acceleration.y === null ||
        e.acceleration.z === null
      )
        return

      // 加速度のキャリブレーション
      if (
        calibration_acceleration_x === 0 &&
        calibration_acceleration_y === 0
      ) {
        calibration_acceleration_x = e.acceleration.x * -1
        calibration_acceleration_y = e.acceleration.y * -1
      }
      // 加速度をGに変換
      const g_x = (e.acceleration.x + calibration_acceleration_x) / 9.8
      const g_y = (e.acceleration.y + calibration_acceleration_y) / 9.8

      // ローパスフィルタでのノイズ削除
      adjust_g_acceleration_x.value = useAccelerationSensor
        .filter(before_g_x, g_x)
        .LPF()
      adjust_g_acceleration_y.value = useAccelerationSensor
        .filter(before_g_y, g_y)
        .LPF()
      before_g_x = g_x
      before_g_y = g_y

      // Gの角度を算出
      angle.value = pointToAtan2({ x: g_x, y: g_y }) + 3

      //music.play()

      // const music = new Audio(
      //   'https://848f-60-91-83-78.ngrok.io/storage/04G12.mp3'
      // )
      // music.play()
      //// Gを1.1~-1.1に収まるように調整を行う
      // adjust_g_acceleration_x.value =
      //   g_x > 0 ? (g_x > max_g ? max_g : g_x) : g_x < -max_g ? -max_g : g_x
      // adjust_g_acceleration_y.value =
      //   g_y > 0 ? (g_y > max_g ? max_g : g_y) : g_y < -max_g ? -max_g : g_y

      // adjust_g_acceleration_x_log.push(adjust_g_acceleration_x.value)
      // adjust_g_acceleration_y_log.push(adjust_g_acceleration_y.value)
    }

    return {
      clickDraw,
      clickStartAccelerationSensor,
      router,
      draw,
      adjust_g_acceleration_x,
      adjust_g_acceleration_y,
      chartAcceleration,
      angle,
    }
  },
  computed: {},
})
</script>
